{
    "$schema": "http://json-schema.org/draft-04/schema#",
    "title": "CLM_Alert",
    "type": "object",
    "required": [
        "Alert"
    ],
    "properties": {
        "Alert": {
            "type": "string",
            "$ref": "#/datos"
        }
    },
    "datos": {
        "description": "Info CLM_Alert",
        "type": "object",
        "required": [
            "name",
            "type",
            "severity",
            "description",
            "timestamp",
            "moduleCLM",
            "area",
            "subarea",
            "responsable",
            "state"
        ],
        "properties": {
            "name": {
                "type": "string"
            },
            "type": {
                "type": "string"
            },
            "severity": {
                "type": "string",
                "enum": [
                    "1-high",
                    "2-medium",
                    "3-low"
                ]
            },
            "description": {
                "type": "string"
            },
            "timestamp": {
                "type": "object",
                "required": [
                    "$date"
                ],
                "properties": {
                    "$date": {
                        "type": "string",
                        "format": "date-time"
                    }
                }
            },
            "moduleCLM": {
                "type": "string",
                "enum": [
                    "Environment",
                    "Parks and gardens",
                    "Mobility"
                ]
            },
            "area": {
                "type": "string"
            },
            "subarea": {
                "type": "string"
            },
            "responsable": {
                "type": "string"
            },
            "state": {
                "type": "string",
                "enum": [
                    "open",
                    "closed"
                ]
            },
            "timestampClose": {
                "type": "object",
                "required": [
                    "$date"
                ],
                "properties": {
                    "$date": {
                        "type": "string",
                        "format": "date-time"
                    }
                }
            },
            "standardLocation": {
                "description": "ISO location",
                "type": "object",
                "required": [
                    "iso3166_1",
                    "iso3166_2",
                    "un_LOCODE"
                ],
                "properties": {
                    "iso3166_1": {
                        "type": "string"
                    },
                    "iso3166_2": {
                        "type": "string"
                    },
                    "un_LOCODE": {
                        "type": "string"
                    },
                    "district": {
                        "type": "string"
                    }
                }
            },
            "geometry": {
                "title": "geometry",
                "description": "One geometry as defined by GeoJSON",
                "type": "object",
                "oneOf": [
                    {
                        "title": "Point",
                        "required": [
                            "type",
                            "coordinates"
                        ],
                        "additionalProperties": false,
                        "properties": {
                            "type": {
                                "enum": [
                                    "Point"
                                ]
                            },
                            "coordinates": {
                                "$ref": "#/definitions/position"
                            }
                        }
                    },
                    {
                        "title": "MultiPoint",
                        "required": [
                            "type",
                            "coordinates"
                        ],
                        "additionalProperties": false,
                        "properties": {
                            "type": {
                                "enum": [
                                    "MultiPoint"
                                ]
                            },
                            "coordinates": {
                                "$ref": "#/definitions/positionArray"
                            }
                        }
                    },
                    {
                        "title": "LineString",
                        "required": [
                            "type",
                            "coordinates"
                        ],
                        "additionalProperties": false,
                        "properties": {
                            "type": {
                                "enum": [
                                    "LineString"
                                ]
                            },
                            "coordinates": {
                                "$ref": "#/definitions/lineString"
                            }
                        }
                    },
                    {
                        "title": "MultiLineString",
                        "required": [
                            "type",
                            "coordinates"
                        ],
                        "additionalProperties": false,
                        "properties": {
                            "type": {
                                "enum": [
                                    "MultiLineString"
                                ]
                            },
                            "coordinates": {
                                "type": "array",
                                "items": {
                                    "$ref": "#/definitions/lineString"
                                }
                            }
                        }
                    },
                    {
                        "title": "Polygon",
                        "required": [
                            "type",
                            "coordinates"
                        ],
                        "additionalProperties": false,
                        "properties": {
                            "type": {
                                "enum": [
                                    "Polygon"
                                ]
                            },
                            "coordinates": {
                                "$ref": "#/definitions/polygon"
                            }
                        }
                    },
                    {
                        "title": "MultiPolygon",
                        "required": [
                            "type",
                            "coordinates"
                        ],
                        "additionalProperties": false,
                        "properties": {
                            "type": {
                                "enum": [
                                    "MultiPolygon"
                                ]
                            },
                            "coordinates": {
                                "type": "array",
                                "items": {
                                    "$ref": "#/definitions/polygon"
                                }
                            }
                        }
                    }
                ]
            }
        }
    },
    "definitions": {
        "position": {
            "description": "A single position",
            "type": "array",
            "minItems": 2,
            "items": [
                {
                    "type": "number"
                },
                {
                    "type": "number"
                }
            ],
            "additionalItems": false
        },
        "positionArray": {
            "description": "An array of positions",
            "type": "array",
            "items": {
                "$ref": "#/definitions/position"
            }
        },
        "lineString": {
            "description": "An array of two or more positions",
            "allOf": [
                {
                    "$ref": "#/definitions/positionArray"
                },
                {
                    "minItems": 2
                }
            ]
        },
        "linearRing": {
            "description": "An array of four positions where the first equals the last",
            "allOf": [
                {
                    "$ref": "#/definitions/positionArray"
                },
                {
                    "minItems": 4
                }
            ]
        },
        "polygon": {
            "description": "An array of linear rings",
            "type": "array",
            "items": {
                "$ref": "#/definitions/linearRing"
            }
        }
    },
    "description": "Ontology Alert for CLM",
    "additionalProperties": true
}
